import './short-about-me.css'

const Abouts = () =>{
    return(
        <div className='app-about-me'>
                <div className='about-container'>
                    <p className='intro'>A little bit about me</p>
                    <p className='body'> I'm a Software Developer -  I enjoy solving algorithms and learning more about programming languages :)</p>
                </div>
        </div>
    )
}

export default Abouts
